export default function Progress({
  numQuestions,
  activeQuestion,
  maxPoints,
  currentPoints,
}) {
  return (
    <header className="progress">
      <progress />
      <p>
        Question <strong>{activeQuestion + 1}</strong>/{numQuestions}
      </p>
      <p>
        <strong>{currentPoints}</strong>/{maxPoints}
      </p>
    </header>
  );
}
